<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Proxy Cache Test</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #f4f4f9;
            color: #333;
        }

        header {
            background-color: #1a641d;
            color: white;
            padding: 1rem 2rem;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        header h1 {
            margin: 0;
        }

        header ul {
            list-style: none;
            margin: 0;
            padding: 0;
            display: flex;
        }

        header ul li {
            margin-left: 20px;
        }

        header ul li a {
            text-decoration: none;
            color: white;
            font-weight: bold;
        }

        #welcome {
            
            background-color: #e8f5e9;
            padding: 1.5rem;
            text-align: center;
            margin: 1rem auto;
            border-radius: 8px;
            max-width: 900px;
            height: 200px;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
        }

        #etudiants {
            display: flex;
            justify-content: center;
            flex-wrap: wrap;
            gap: 20px;
            margin: 2rem auto;
            max-width: 1200px;
        }

        .stude {
            background-color: white;
            border: 1px solid #ddd;
            border-radius: 8px;
            overflow: hidden;
            width: 250px;
            text-align: center;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .stude img {
            width: 100%;
            height: auto;
        }

        #desc {
            padding: 1rem;
        }

        #desc h2 {
            margin: 0.5rem 0;
        }

        #desc h3 {
            color: #666;
            font-size: 0.9rem;
            margin: 0;
        }

        footer {
            background-color: #1a641d;
            color: white;
            text-align: center;
            padding: 1rem 0;
            margin-top: 2rem;
        }
    </style>
</head>
